export default (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:i,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:i,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:j,pageSize:25,pageCount:j,total:5}}},j5demMkuKy:{data:{id:543,attributes:{imdbId:"tt0052680",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNWU4MDBmMTEtM2Q4My00MGFmLThhNGQtMjMxYWY4NjRjNGI0XkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.4\u002F10"}],item_lang:{data:{id:1206,attributes:{title:c,plot:"Cash McCall is a young and slick business man who buys failing businesses and resells them. Grant Austen's Plastics is even more of a prize to Cash, for Cash is also making a bid for Austen's beautiful daughter, Lory. This is Cash's toughest deal ever.",slug:"cash-mccall"}}},books:{data:[{id:3968,attributes:{title:c,description:k,thumbnail:l,authors:[a],firstBook:true,published:d,publisher:e,subtitle:f}},{id:3969,attributes:{title:c,description:k,thumbnail:l,authors:[a],firstBook:g,published:d,publisher:e,subtitle:f}},{id:3970,attributes:{title:c,description:h,thumbnail:h,authors:[a],firstBook:g,published:"1000-01-01",publisher:h,subtitle:h}},{id:3971,attributes:{title:"Executive Suite",description:"Five ambitious executives vie for the top job at a major corporation after the president suddenly drops dead in this classic business novel Fifty-six-year-old Tredway Corporation president Avery Bullard is getting into a taxi after a business lunch in Manhattan when he collapses from a cerebral hemorrhage. Although his body isn’t immediately identified, the reverberations of his death will soon be felt in the boardrooms of every branch of his company. In the minutes before he died, Bullard had finally decided on whom to appoint as his executive vice president—but he never got the chance to announce his selection. Now, with no successor in place, five corporate VPs—comptroller Loren P. Shaw, treasurer Frederick W. Alderson, design and development director Don Walling, manufacturing chief Jesse Grimm, and head of sales J. Walter Dudley—compete for the top position. Who will ascend to the executive suite? From the long-simmering resentments to the startling power plays, insider trading to rapid business decisions and personal dramas, Executive Suite is a riveting novel as well as an authentic and timeless depiction of how a corporation operates and what it takes to succeed in business.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yoXICgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:g,published:d,publisher:e,subtitle:f}},{id:3972,attributes:{title:"The Hurricane Years",description:"An accomplished businessman faces the biggest challenge of his life when his race to the top is halted by a heart attack in this New York Times bestseller from the author of Executive Suite After a business trip to New York, advertising executive Judd Wilder returns to Pennsylvania, where he plans to drop off the annual stockholders’ report with his boss at Crouch Carpet Company. There’s no warning, no premonition of disaster, just a slight case of indigestion, which escalates into debilitating pain. Taken by ambulance to the local hospital, Judd at first refuses to believe that he has suffered a heart attack. Dr. Aaron Kharr specializes in cardiac behavior patterns. In Judd, he sees a businessman in his peak stress years whose long-building tensions have erupted in an emotional hurricane. Kharr’s goal is to heal both Judd’s mind and his body. As the doc studies the events in his patient’s past that have led to this point, Judd’s company undergoes a change of ownership and reorganization that mirrors his own recovery. With its multi-layered plot and teeming canvas of characters, including Judd’s wife, Kay; their son, Rolfe; and the fascinating Matthew Crouch, The Hurricane Years is a captivating novel about the rewards and pitfalls of corporate life.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=hofICgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:g,published:d,publisher:e,subtitle:f}}]}}},meta:{}}},prerenderedAt:1681309159919}}("Cameron Hawley","movie","Cash McCall","2015-12-08","Open Road Media","A Novel",null,"","series",1,"A financial adventurer becomes a hero to some, a villain to many, and a lover to one as he buys and sells companies in a thrilling game of wits and cunning in this New York Times bestseller from the author of Executive Suite Cash McCall is a believer in free enterprise, a man not yet forty who buys, sells, and merges companies to make huge profits in a postwar nation of conformist “company men.” McCall is an enigma who operates out of an expensive tenth-floor suite in a Philadelphia hotel that he may or may not own. He’s single, conducts secret business meetings, and is both envied and hated. No one knows where he came from. Grant Austen spent three decades building his plastics company. Now, as he seeks counsel from his banker and lawyer about selling out, he unwittingly triggers a whirlwind of corporate and financial maneuvering he doesn’t fully understand. And his daughter, Lory, commits the cardinal sin of falling in love with Cash McCall, the man who’s about to buy her father’s company out from under him. But who is Cash McCall? A ruthless operator or a rugged individualist? Reminiscent of Ayn Rand’s The Fountainhead, this is a novel about love, the free enterprise system, and one man’s refusal to be anyone but himself.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OYbICgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api"))